import { Route } from 'react-router-dom';
import Board from './Board';
import Register from './Register';
import Login from './Login';
import Post from './Post';
import Detail from './Detail';
import Mypage from './Mypage';

function App(){
  return (
    <div class ="App">
      어쩌구저쩌구
      <Route exact path="/">           
        <Board/>
      </Route>

      <Route path="/detail">
        <Detail />
      </Route>

      <Route path ="/register">
         <Register />
      </Route>

      <Route path ="/login">
         <Login/>
      </Route>

      <Route path ="/post">
         <Post />
      </Route>

      <Route path ="/mypage">
         <Mypage />
      </Route>

    </div>
  )
}

export default App;
